package prefix

import (
	"fmt"
	"strconv"
	"testing"
)


var randomStrings = []string{
  "12345",
  "abcde",
  "!@#$%",
  "Hello, World!",
  "123abc456",
  "  ",
  "",
  "null",
  "undefined",
  "true",
  "false",
  "1.2345",
  "-987.654",
  "0",
  "-0",
  "Infinity",
  "-Infinity",
  "NaN",
  "A very long string with many characters.",
  "A string with a single quote (').",
  "A string with a double quote (\").",
  "A string with a backslash.",
  "A string with a newline character (\n).",
  "A string with a tab character (\t).",
  "A string with a carriage return character (\r).",
  "A string with a form feed character (\f).",
  "A string with a vertical tab character (\v).",
  "A string with a backspace character (\b).",
  "A string with a null character.",
  "A string with a control character (\x01).",
  "A string with a non-printable character (\x1B).",
  "A string with a Unicode character (üòÄ).",
  "A string with a UTF-8 encoded character (‰∏ñÁïå).",
  "A string with a UTF-16 encoded character (êê∑).",
  "A string with a UTF-32 encoded character (ùåÜ).",
  "A string with a mix of different character encodings.",
  "A string with a very long sequence of the same character (",
}
func TestPrefixWithId(t *testing.T){

    for _,s:=range randomStrings{
	for i := 1; i <= 1000; i++ {
    if PrefixWithId(s, i) != strconv.Itoa(i)+"-"+ s{
    t.Error(fmt.Sprintf("PrefixWithId(%s, %d) is not: %s", s, i, s))
	}
	}
}
}

func TestDeprefixWithId(t *testing.T){

    for _,s:=range randomStrings{
	for i := 1; i <= 1000; i++ {
    if DePrefixWithId(PrefixWithId(s, i), i) != s{
    t.Error(fmt.Sprintf("DePrefixWithId(PrefixWithId(%s, %d), %d) is not: ", s, i, i))
	}
	}
}
}
